import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './LogFitness.css';

const LogFitness: React.FC = () => {
    const navigate = useNavigate();
    const [weight, setWeight] = useState('');
    const [measurements, setMeasurements] = useState({ waist: '', chest: '', hips: '' });
    const [achievement, setAchievement] = useState('');
    const [logs, setLogs] = useState<{ date: string; weight: string; measurements: typeof measurements; achievement: string }[]>([]);

    const handleSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        const newLog = {
            date: new Date().toLocaleDateString(),
            weight,
            measurements,
            achievement,
        };
        setLogs([...logs, newLog]);
        setWeight('');
        setMeasurements({ waist: '', chest: '', hips: '' });
        setAchievement('');
    };

    const handleDelete = (index: number) => {
        const newLogs = logs.filter((_, i) => i !== index);
        setLogs(newLogs);
    };

    return (
        <div className="log-fitness">
            <h1>Log Your Fitness Progress</h1>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="weight">Weight (kg):</label>
                    <input
                        type="number"
                        id="weight"
                        value={weight}
                        onChange={(e) => setWeight(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="waist">Waist (cm):</label>
                    <input
                        type="number"
                        id="waist"
                        value={measurements.waist}
                        onChange={(e) => setMeasurements({ ...measurements, waist: e.target.value })}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="chest">Chest (cm):</label>
                    <input
                        type="number"
                        id="chest"
                        value={measurements.chest}
                        onChange={(e) => setMeasurements({ ...measurements, chest: e.target.value })}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="hips">Hips (cm):</label>
                    <input
                        type="number"
                        id="hips"
                        value={measurements.hips}
                        onChange={(e) => setMeasurements({ ...measurements, hips: e.target.value })}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="achievement">Achievements:</label>
                    <input
                        type="text"
                        id="achievement"
                        value={achievement}
                        onChange={(e) => setAchievement(e.target.value)}
                    />
                </div>
                <button type="submit">Log</button>
            </form>
            <div className="log-list">
                <h2>Logged Progress</h2>
                <ul>
                    {logs.map((log, index) => (
                        <li key={index}>
                            <strong>{log.date}</strong>: Weight: {log.weight}kg, Waist: {log.measurements.waist}cm, 
                            Chest: {log.measurements.chest}cm, Hips: {log.measurements.hips}cm, 
                            Achievement: {log.achievement}
                            <button className="delete-btn" onClick={() => handleDelete(index)}>Delete</button>
                        </li>
                    ))}
                </ul>
            </div>

            {/* Back Button */}
            <div className="action-buttons">
             
                    
                
                <button className="back-btn" onClick={() => navigate('/')}>
                    Return to Home
                </button>
            </div>
        </div>
    );
};

export default LogFitness;
